Director: Ethan Kane
Cast: Bree Olson, Ava Rose, Niki Blond, Roxy Panther, Steve Holmes, David Perry, James Brossman, Alex, Karim

XXX Marks The Spot Ava Rose stars as Carolina Jones, the daughter of Prof. Indy Jones, and she's taking over for daddy in Carolina Jones and the Broken Covenant. The Ark of the Covenant is missing, and it's up to Carolina and her sidekick (Bree Olson) to retrieve it! Their quest leads them through perilous situations and dangerous confrontations, as well as seductive sexual encounters and naughty predicaments! Will Carolina be able to recover the Ark of the Covenant from those who would use it for evil? Find out in Carolina Jones and the Broken Covenant, the newest adventure from Ethan Kane!

